import React,{Component} from 'react'
import { View, 
    Text, 
    TouchableOpacity, 
    Dimensions,
    StyleSheet,
    
Image,
ImageBackground,} from 'react-native';


const Date=(props) =>{

   


    return (
        
         <TouchableOpacity style={{position: 'absolute'}}>
         <Text style={{fontSize: 16,borderRadius:500,backgroundColor:'white',width:40,paddingLeft:10,marginLeft:11}}>{props.date}</Text>

         </TouchableOpacity>
         
               
           
        


    
    );
}


;
export default Date;
